import base64
import json
import string

def test_data():
    path = r'C:\Users\it009991\AppData\Roaming\ZHElectron\file\pr_volunteer_apply_202303101023.csv'

    file = open(path,'r',encoding='utf-8')
    content = file.readlines()
    print(f'content={content}')
    fields = content[0].split(',')
    # values = content[1].split(',')
    res ={"volunteers":[]}
    for values in content[1:]:
        data = {}
        for index in range(0,len(fields)):
            field = fields[index]
            value = values[index]
            field = field[0].upper() + field[1:]
            for i in string.ascii_lowercase:
                field = field.replace(f'_{i}', i.upper())
            field = field.replace('"','').replace('\n','')
            value = value.replace('"', '')
            # if field in ['qr_code','picture']:
            #     value = ""

            data[field] = value
        res['volunteers'].append(data)
    print(res)
    print(json.dumps(res,ensure_ascii=False))



if __name__ == '__main__':
    test_data()
